package com.manheiminfoscanner.model;

import android.os.Parcel;
import android.os.Parcelable;

import java.util.ArrayList;

/**
 * Created by zfolkz on 12/20/2016 AD.
 */

public class PhotoData implements Parcelable {

    private static PhotoData ourInstance = new PhotoData();
    private ArrayList<GetDocumentItemsResultBean> GetDocumentItemsResult;

    public static PhotoData getInstance() {
        return ourInstance;
    }

    private PhotoData() {

    }

    public ArrayList<GetDocumentItemsResultBean> getGetDocumentItemsResult() {
        return GetDocumentItemsResult;
    }

    public void setGetDocumentItemsResult(ArrayList<GetDocumentItemsResultBean> GetDocumentItemsResult) {
        this.GetDocumentItemsResult = GetDocumentItemsResult;
    }


    public static class GetDocumentItemsResultBean {
        /**
         * DocumentDescription_BU : Book In & Inspection Report
         * DocumentDescription_LO : Book In & Inspection Report
         * DocumentFile : 
         * DocumentLenght : 1
         * DocumentTypeID : 1
         * Vehicle : 000000000001214559
         */

        private String DocumentDescription_BU;
        private String DocumentDescription_LO;
        private String DocumentFile;
        private int DocumentLenght;
        private int DocumentTypeID;
        private String Vehicle;
        private String AuctionCode;
        private String saveDate;
        private int LotNumber;

        public int getLotNumber() {
            return LotNumber;
        }

        public void setLotNumber(int lotNumber) {
            LotNumber = lotNumber;
        }

        public String getAuctionCode() {
            return AuctionCode;
        }

        public void setAuctionCode(String auctionCode) {
            AuctionCode = auctionCode;
        }

        public String getSaveDate() {
            return saveDate;
        }

        public void setSaveDate(String saveDate) {
            this.saveDate = saveDate;
        }

        public String getDocumentDescription_BU() {
            return DocumentDescription_BU;
        }

        public void setDocumentDescription_BU(String DocumentDescription_BU) {
            this.DocumentDescription_BU = DocumentDescription_BU;
        }

        public String getDocumentDescription_LO() {
            return DocumentDescription_LO;
        }

        public void setDocumentDescription_LO(String DocumentDescription_LO) {
            this.DocumentDescription_LO = DocumentDescription_LO;
        }

        public String getDocumentFile() {
            return DocumentFile;
        }

        public void setDocumentFile(String DocumentFile) {
            this.DocumentFile = DocumentFile;
        }

        public int getDocumentLenght() {
            return DocumentLenght;
        }

        public void setDocumentLenght(int DocumentLenght) {
            this.DocumentLenght = DocumentLenght;
        }

        public int getDocumentTypeID() {
            return DocumentTypeID;
        }

        public void setDocumentTypeID(int DocumentTypeID) {
            this.DocumentTypeID = DocumentTypeID;
        }

        public String getVehicle() {
            return Vehicle;
        }

        public void setVehicle(String Vehicle) {
            this.Vehicle = Vehicle;
        }
    }

    @Override
    public int describeContents() {
        return 0;
    }

    @Override
    public void writeToParcel(Parcel dest, int flags) {
        dest.writeList(this.GetDocumentItemsResult);
    }

    protected PhotoData(Parcel in) {
        this.GetDocumentItemsResult = new ArrayList<GetDocumentItemsResultBean>();
        in.readList(this.GetDocumentItemsResult, GetDocumentItemsResultBean.class.getClassLoader());
    }

    public static final Creator<PhotoData> CREATOR = new Creator<PhotoData>() {
        @Override
        public PhotoData createFromParcel(Parcel source) {
            return new PhotoData(source);
        }

        @Override
        public PhotoData[] newArray(int size) {
            return new PhotoData[size];
        }
    };
}
